import React, { Component } from 'react'

export default class List extends Component {
    render() {
        return (
            <ul className="todo-mian">
                <li>
                    <label>
                        <input type="checkbox" />
                        <span>xxxxxx</span>
                    </label>
                    <button className="btn btn-danger" style={{ display: 'none' }}>删除</button>
                </li>
            </ul>
        )
    }
}
